(767, 'Garuga Shard', 'Yian Garuga', 8, 4410, 'A top-grade Garuga scale. It sparkles like purple quartz and is just as hard.'),
(768, 'Garuga Shell', 'Yian Garuga', 4, 650, 'A rare item, also in great demand as a research material.'),
(769, 'Garuga Silverpelt', 'Yian Garuga', 8, 1800, 'A shimmering silver pelt that mesmerizes all with its beauty when it flutters.'),
(770, 'Garuga Tail', 'Yian Garuga', 4, 2000, 'The tail of a Yian Garuga. Responds to shocks by spouting a powerful venom.'),
(771, 'Garuga Wing', 'Yian Garuga', 4, 1950, 'A first class material that requires high crafting skills to work with.'),
(772, 'Lrg Wyvern Gem', 'Yian Garuga', 9, 12000, 'A Wyvern Gem grown especially large after years of collecting mass. Emits a peculiar glow.'),
(773, 'Rejuvenated Beak', 'Yian Garuga', 6, 3600, 'A Yian Garuga beak. Its color, luster, and the jawline''s angle have been restored.'),
(774, 'Sharpened Beak', 'Yian Garuga', 4, 1800, 'The sharpened beak of a Yian Garuga. Looks fiercer than that of a Kut-Ku.');
INSERT INTO `carves` (`id`, `name`, `monster`, `rare`, `sell`, `description`) VALUES
(775, 'Giant Beak', 'Yian Kut-Ku', 4, 1500, 'The huge, sturdy beak of a Yian Kut-Ku.'),
(776, 'Kut-Ku Auricle', 'Yian Kut-Ku', 6, 2560, 'A Kut-Ku''s Fire-resistant ear. The flexible material is a good base for armor.'),
(777, 'Kut-Ku Carapace', 'Yian Kut-Ku', 6, 1035, 'Harder than Kut-Ku Shell, this material is also known as Gravite.'),
(778, 'Kut-Ku Cortex', 'Yian Kut-Ku', 8, 3105, 'A stout outer shell, much harder than a carapace. Also called Mediastinum.'),
(779, 'Kut-Ku Ear', 'Yian Kut-Ku', 4, 1280, 'The Fire-resistant ear of a Kut-Ku. Used to prevent Bowguns backfiring.'),
(780, 'Kut-Ku Fellwing', 'Yian Kut-Ku', 8, 5850, 'A top-grade Kut-Ku wing. Stout, expansive, and highly resistant to fire.'),
(781, 'Kut-Ku Luckear', 'Yian Kut-Ku', 8, 5120, 'A full grown Kut-Ku ear. Considered a good luck charm due to its texture and form.'),
(782, 'Kut-Ku Scale', 'Yian Kut-Ku', 4, 250, 'Pink scale from a Kut-Ku. Fire resistant. Can be found in the field.'),
(783, 'Kut-Ku Scale+', 'Yian Kut-Ku', 6, 750, 'Superior scale from a Kut-Ku. Its size and weight make it look classier than normal.'),
(784, 'Kut-Ku Shard', 'Yian Kut-Ku', 8, 2250, 'A superb Kut-Ku scale. It''s rare to see scales mature to this degree.'),
(785, 'Kut-Ku Shell', 'Yian Kut-Ku', 4, 345, 'The Fire-resistant shell of a Kut-Ku.'),
(786, 'Kut-Ku Webbing', 'Yian Kut-Ku', 4, 650, 'Webbing from a Kut-Ku wing. Better than animal skin as a fusing material.'),
(787, 'Splendid Beak', 'Yian Kut-Ku', 6, 3000, 'Finding a large, beautiful beak in this condition is quite rare! Splendid!'),
(788, 'Blue Kut-Ku Carapace', 'Yian Kut-Ku (Blue)', 6, 1380, 'Rare Blue Yian Kut-Ku Carapace. Harder than the shell. Often used in crafting.'),
(789, 'Blue Kut-Ku Cortex', 'Yian Kut-Ku (Blue)', 8, 4140, 'An outer shell even thicker than a regular Carapace. The desire of artisans everywhere.'),
(790, 'Blue Kut-Ku Scale+', 'Yian Kut-Ku (Blue)', 6, 1125, 'Superior scale from a Blue Yian Kut-Ku. Its complex color is infinitely cool.'),
(791, 'Blue Kut-Ku Shard', 'Yian Kut-Ku (Blue)', 8, 3375, 'A super thick Blue Kut-Ku scale. As blue as the ocean, it''s considered nature''s masterpiece.'),
(792, 'Giant Beak', 'Yian Kut-Ku (Blue)', 4, 1500, 'The huge, sturdy beak of a Yian Kut-Ku.'),
(793, 'Kut-Ku Auricle', 'Yian Kut-Ku (Blue)', 6, 2560, 'A Kut-Ku''s Fire-resistant ear. The flexible material is a good base for armor.'),
(794, 'Kut-Ku Ear', 'Yian Kut-Ku (Blue)', 4, 1280, 'The Fire-resistant ear of a Kut-Ku. Used to prevent Bowguns backfiring.'),
(795, 'Kut-Ku Fellwing', 'Yian Kut-Ku (Blue)', 8, 5850, 'A top-grade Kut-Ku wing. Stout, expansive, and highly resistant to fire.'),
(796, 'Kut-Ku Luckear', 'Yian Kut-Ku (Blue)', 8, 5120, 'A full grown Kut-Ku ear. Considered a good luck charm due to its texture and form.'),
(797, 'Kut-Ku Webbing', 'Yian Kut-Ku (Blue)', 4, 650, 'Webbing from a Kut-Ku wing. Better than animal skin as a fusing material.'),
(798, 'Splendid Beak', 'Yian Kut-Ku (Blue)', 6, 3000, 'Finding a large, beautiful beak in this condition is quite rare! Splendid!'),
(799, 'Crushing Fang', 'Zamite', 8, 4500, 'The strongest fang of a fanged beast. It can pierce a monster''s shell as if it were paper.'),
(800, 'Meaty Hide', 'Zamite', 4, 90, 'A stretchy hide from a Zamite''s underbelly. Thick and unlikely to tear.'),
(801, 'Meaty Hide+', 'Zamite', 6, 280, 'A hide from the underbelly of a Zamite. The most elastic samples are costly.'),
(802, 'Meaty Piel', 'Zamite', 8, 840, 'A hide from the underbelly of a Zamite. This finest specimen makes good padding.'),
(803, 'Sharp Fang', 'Zamite', 4, 170, 'Fangs come in many shapes and sizes -- the right fang for the right job.'),
(804, 'Sharqskin Scale', 'Zamite', 4, 120, 'Zamite skin that feels smooth or coarse depending on which way you rub it.'),
(805, 'Zamtrios Fin', 'Zamtrios', 4, 830, 'The Zamtrios''s distinctive dorsal fin. Rigid, but still has the skin''s texture.'),
(806, 'Zamtrios Fin+', 'Zamtrios', 6, 2490, 'A quality dorsal fin that''s in high demand. Big fins go for a premium at market'),
(807, 'Zamtrios Grandfin', 'Zamtrios', 8, 7470, 'A huge dorsal fin that cuts gracefully through the ice. Loved by artisans and hunters.'),
(808, 'Zamtrios Hide', 'Zamtrios', 4, 410, 'A stretchy hide prized for durability; it tears only as a defense mechanism.'),
(809, 'Zamtrios Hide+', 'Zamtrios', 6, 1230, 'A fine, stretchy hide. It tears only after new, harder skin has formed underneath.'),
(810, 'Zamtrios Piel', 'Zamtrios', 8, 3690, 'A thick, elastic hide with high Ice resistance. Like wearing winter, yet warm.'),
(811, 'Zamtrios Sawtooth', 'Zamtrios', 4, 1200, 'A blunt tooth that slowly and painfully tears through the Zamtrios''s prey.'),
(812, 'Zamtrios Sawtooth+', 'Zamtrios', 8, 4800, 'Triangular, saw-like teeth for biting and crushing. Will grow back if pulled out.'),
(813, 'Zamtrios Scale', 'Zamtrios', 4, 740, 'One of the back scales that gives the Zamtrios its smooth-but-coarse texture.'),
(814, 'Zamtrios Scale+', 'Zamtrios', 6, 2220, 'A fine scale that functions like sandpaper. Used to hone the edges of weapons.'),
(815, 'Zamtrios Shard', 'Zamtrios', 8, 6660, 'One of many thick, razor- sharp scales that shred any foolish enough to touch.'),
(816, 'Zamtrios Tailblade', 'Zamtrios', 4, 1080, 'A razor-sharp tail that does as well as any axe if one brings it down hard.'),
(817, 'Zamtrios Tailbrand', 'Zamtrios', 8, 4320, 'A large tail whose meaty swings can knock prey out with a single lash.'),
(818, 'T.Zamtrios Grandfin', 'Zamtrios (Tigerstripe)', 8, 9710, 'A huge dorsal fin that makes caravan merchants uneasy when sighted in the sands.'),
(819, 'T.Zamtrios Piel', 'Zamtrios (Tigerstripe)', 8, 4790, 'A thick, elastic hide that retains water well, making it perfect for desert hunts.'),
(820, 'T.Zamtrios Sawtooth+', 'Zamtrios (Tigerstripe)', 8, 6240, 'A triangular tooth that, in tandem with its brothers, digs in and saws prey apart.'),
(821, 'T.Zamtrios Shard', 'Zamtrios (Tigerstripe)', 8, 8650, 'A hard, thick scale whose smooth surface was created either by or for the sand.'),
(822, 'T.Zamtrios Tailbrand', 'Zamtrios (Tigerstripe)', 8, 5610, 'A huge tail with a barb on the end. Mows targets down in the blink of an eye.'),
(823, 'Zin Electrofur', 'Zinogre', 6, 1470, 'Zinogre fur said to store a high amount of electricity. Shines white from the charge.'),
(824, 'Zin Electrofur+', 'Zinogre', 8, 4410, 'Zinogre fur said to store an endless amount of electricity. Shines with intense light.'),
(825, 'Zin Shockfur', 'Zinogre', 4, 490, 'White fur that stores and magnifies electricity, which it retains even after carving.'),
(826, 'Zinogre Carapace', 'Zinogre', 6, 1950, 'The teal carapace of a Zinogre. Its magnificence reveals the futility of facing the monarch.'),
(827, 'Zinogre Claw', 'Zinogre', 4, 700, 'A sharp and tremendously powerful claw capable of quickly dicing up prey.'),
(828, 'Zinogre Claw+', 'Zinogre', 6, 2100, 'A sharp, high-voltage Zinogre claw. Its electrified attacks are truly brutal.'),
(829, 'Zinogre Cortex', 'Zinogre', 8, 5850, 'The teal cortex of a Zinogre. The monarch''s armor crushes wills with its immense power.'),
(830, 'Zinogre D-Shocker', 'Zinogre', 8, 7200, 'A shell with electric power that shames even lightning. Its effect on forged equipment is vast.'),
(831, 'Zinogre Hardclaw', 'Zinogre', 8, 6300, 'A rigid, high-voltage Zinogre talon. Its electrified attacks threaten all existence.'),
(832, 'Zinogre Hardhorn', 'Zinogre', 8, 7560, 'A mighty Zinogre horn. None can stand before its sky-shattering, awe-inspiring power.'),
(833, 'Zinogre Horn', 'Zinogre', 4, 840, 'The Zinogre''s magnificent horn, which sends most of nature running for cover.'),
(834, 'Zinogre Horn+', 'Zinogre', 6, 2520, 'A pointed Zinogre horn. When carved, it can be used to grant equipment incomparable power.'),
(835, 'Zinogre Jasper', 'Zinogre', 7, 9700, 'A rare gem sometimes produced inside a Zinogre''s body. The monarch''s power swells within.'),
(836, 'Zinogre Lash', 'Zinogre', 8, 9200, 'A superior Zinogre tail that wields incomparable destructive power.'),
(837, 'Zinogre Plate', 'Zinogre', 5, 4850, 'A rare and intimidating trophy that seems to pulse with residual fury.'),
(838, 'Zinogre Shell', 'Zinogre', 4, 650, 'A blue-green shell which stores electricity and works as a protective insulator.'),
(839, 'Zinogre Shocker', 'Zinogre', 4, 800, 'The ocher shell that once lined a Zinogre''s body. Contains conductive lipids.'),
(840, 'Zinogre Shocker+', 'Zinogre', 6, 2400, 'A Zinogre shell that stores and releases electricity. Grants a thunder god''s power to gear.'),
(841, 'Zinogre Skymerald', 'Zinogre', 9, 14200, 'An extremely rare gem found only in select Zinogres. Proof of the overwhelming warrior.'),
(842, 'Zinogre Tail', 'Zinogre', 4, 1200, 'The plate-covered tail of a Zinogre. It wields deadly force when swung.'),
(843, 'Dracophage Bug', 'Zinogre (Stygian)', 6, 500, 'Dragonfell Berry-loving bugs that store up Dragon energy. A Stygian Zinogre''s power source.'),
(844, 'S.Zin Dragonlocks', 'Zinogre (Stygian)', 8, 5700, 'A mane containing Dracophage Bugs which give off red and black electric flashes.'),
(845, 'S.Zin Skymerald', 'Zinogre (Stygian)', 9, 15620, 'An extremely rare gem found only in select Stygian Zinogres. Proof of the absolute conqueror.'),
(846, 'S.Zinogre Carapace', 'Zinogre (Stygian)', 6, 2500, 'The black shell of a Stygian Zinogre. It''s like walking around with a slice of hell.'),
(847, 'S.Zinogre Claw+', 'Zinogre (Stygian)', 6, 2730, 'A devastating claw one could easily use to carve one''s place as absolute ruler.'),
(848, 'S.Zinogre Cortex', 'Zinogre (Stygian)', 8, 6440, 'The black cortex of a Stygian Zinogre. A wicked power hides within this hellish shell.'),
(849, 'S.Zinogre Dragonhair', 'Zinogre (Stygian)', 6, 1900, 'Brute dragonhair from a Stygian Zinogre. Dragons fear the dragon-slaying energy within.'),
(850, 'S.Zinogre Drakehold', 'Zinogre (Stygian)', 8, 7920, 'A carapace that stores power from Dracophage Bugs. More power yields better gear.'),
(851, 'S.Zinogre Drakeshell', 'Zinogre (Stygian)', 6, 3120, 'A Stygian Zinogre shell with potent Dragon energy, likely to be highly suitable for crafting.'),
(852, 'S.Zinogre Hardclaw', 'Zinogre (Stygian)', 8, 6930, 'A Stygian Zinogre''s thick talon. Powerful enough to carve a place for the absolute ruler.'),
(853, 'S.Zinogre Hardhorn', 'Zinogre (Stygian)', 8, 8320, 'A Stygian Zinogre''s rigid horn. Does its mighty power represent a rebellion against dragons?'),
(854, 'S.Zinogre Horn+', 'Zinogre (Stygian)', 6, 3300, 'A terrifying horn, now a defiant declaration of war on all dragons.'),
(855, 'S.Zinogre Lash', 'Zinogre (Stygian)', 8, 10120, 'A Stygian Zinogre''s terrifyingly strong tail. Said to be able to slice through solid steel.'),
(856, 'S.Zinogre Tail', 'Zinogre (Stygian)', 6, 3200, 'The muscular tail of a Zinogre, which could quickly rip right through steel.'),
(857, 'S.Zinogre Umbrage', 'Zinogre (Stygian)', 7, 9700, 'A rock that only sometimes forms in the belly. Do dead prey live on within it?');
